import FloatModal from "../modalbase";

const Add_ticket_modal = (props) => {
    return (
        <FloatModal {...props}>
            <div class="add-ticket-wrapper">
                <p>New ticket information</p>
                <form autoComplete="false">
                    <input type="text" placeholder="Description of the ticket..." required></input>
                    <input type="submit" placeholder="Description of the ticket..."></input>
                </form>
            </div>
        </FloatModal>
    )
}

export default Add_ticket_modal
